import React, { PureComponent } from 'react'
import './HobbiesInterest.css'

class HobbiesInterestClass extends PureComponent {
    constructor(props) {
        super(props)

        this.state = {
            name: this.props.location.state.name,
            age: this.props.location.state.age
        }
    }

    render() {
        return (
            <div className="container">
                <h1 className="heading1">What is your interest?</h1>
                <div className="hobbies-interests">
                    <div>
                        <input type="checkbox" data-name="Blogging" className="checkbox" />
                        <input type="checkbox" data-name="Art" className="checkbox" />
                        <input type="checkbox" data-name="Writing" className="checkbox" />
                        <input type="checkbox" data-name="Dance" className="checkbox" />
                        <input type="checkbox" data-name="PhotoGraphy" className="checkbox" />
                        <input type="checkbox" data-name="Travel" className="checkbox" />
                        <input type="checkbox" data-name="Music" className="checkbox" />
                        <input type="checkbox" data-name="Reading" className="checkbox" />
                        <input type="checkbox" data-name="Cooking" className="checkbox" />
                        <input type="checkbox" data-name="Sports" className="checkbox" />
                        <input type="checkbox" data-name="Gaming" className="checkbox" />
                        <input type="checkbox" data-name="Gardening" className="checkbox" />
                        <input type="checkbox" data-name="Craft" className="checkbox" />
                    </div>
                </div>
            </div>
        )
    }
}

const HobbiesInterest = (props) => {
    return <HobbiesInterestClass location={props.location} />
}

export default HobbiesInterest;
